import './App.css';
import Header from "./components/header/main/Header";
import Image_top from "./components/fon/Image_top";
import Company from "./components/about_us/Company";
import Cars from "./components/block_cars/main/Cars";
import Services from "./components/block_services/main/Services";
import Heads from "./components/block_on_the_heads/main/Heads";
import Reviews from "./components/block_reviews/main/Reviews";
import Footer from "./components/block_footer/main/Footer";
import {useEffect} from "react";
import Test from "./components/test/Test";


function App() {
    const [data, setData] = React.useState(null);

    useEffect(() => {
        fetch('api/cars')
            .then(element => element.json())
            .then(element => setData(JSON.parse(element)));
    }, []);

    return (
        <div className="App">
            {
                data.map((car) => (
                    <Test key={car.id} {...car} />
                ))
            }

            <Header/>
            <Image_top/>
            <Company/>
            <Cars/>
            <Services/>
            <Heads/>
            <Reviews/>
            <Footer/>
        </div>
    );
}

export default App;
